class Input extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <fieldset>
                <legend>thei</legend>
                <input value={this.props.temperature}></input>
                <div>
                    {this.props.temperature}
                </div>
            </fieldset>
        );
    }
}

export default Input;
